import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import myImg from "../../Assets/avatar.svg";
import Tilt from "react-parallax-tilt";
import {
  AiFillGithub,
  AiOutlineTwitter,
  AiFillInstagram,
} from "react-icons/ai";
import { FaLinkedinIn } from "react-icons/fa";
import cat1 from "../../Assets/cat1real.png";
import { useState } from "react";
import ReactDOM from "react-dom";
import CollapsiblePanel from "./CollapsiblePanel";

function App() {
    const text1 =
        "Shorten";
    const text2 = "Hello my name is Jun";
    const text3 = "I am making this website";
    const text4 = "Currently I am doing that";
    const [collapse, setCollapse] = useState(true);
    const [title, setTitle] = useState("Expand All");
    const [icon, setIcon] = useState("fa fa-chevron-right");
    const collapseAll = () => {
        setCollapse(!collapse);
        setIcon(state => {
            return state === "fa fa-chevron-right"
                ? "fa fa-chevron-down"
                : "fa fa-chevron-right";
        });
        setTitle(state => {
            return state === "Expand All" ? "Collapse All" : "Expand All";
        });
    };
    return (
        <div>
            {/* Expand/Collapse All */}
            {/* <button
                type="button"
                className="btn-warning mt-4 mb-3 float-left"
                onClick={collapseAll}
            >
                <i className={icon} /> {title}
            </button> */}
            <Row noGutters>
            <Col md={4} style={{ paddingTop: 50, paddingRight: 0 }}>
            <img
            //   className="hate"
              src={cat1}
              alt="home pic"
            //   className="img-fluid"
              style={{ maxHeight: "150px" }}
            />
          </Col>
          <Col md={4} style={{ display: 'flex', justifyContent: 'flex-start', marginLeft: '-50px', alignItems: 'center', paddingTop: 50 }}>
          <CollapsiblePanel title="Create a Wallet" collapse={collapse}>
                <span>{text1}</span>
            </CollapsiblePanel>
          </Col>
          </Row>
          <br></br>
          <hr></hr>

          <Row noGutters>
            <Col md={4} style={{ paddingTop: 50, paddingRight: 0 }}>
            <img
            //   className="hate"
              src={cat1}
              alt="home pic"
            //   className="img-fluid"
              style={{ maxHeight: "150px" }}
            />
          </Col>
          <Col md={4} style={{ display: 'flex', justifyContent: 'flex-start', marginLeft: '-50px', alignItems: 'center', paddingTop: 50 }}>
          <CollapsiblePanel  title="Get some Sol" collapse={collapse}>
                <span>{text2}</span>
            </CollapsiblePanel>
          </Col>
          </Row>
          <br></br>

          <Row noGutters>
            <Col md={4} style={{ paddingTop: 50, paddingRight: 0 }}>
            <img
            //   className="hate"
              src={cat1}
              alt="home pic"
            //   className="img-fluid"
              style={{ maxHeight: "150px" }}
            />
          </Col>
          <Col md={4} style={{ display: 'flex', justifyContent: 'flex-start', marginLeft: '-50px', alignItems: 'center', paddingTop: 50 }}>
          <CollapsiblePanel title="Connect to Dexscreener/Jupiter" collapse={collapse}>
                <span>{text3}</span>
            </CollapsiblePanel>
          </Col>
          </Row>
          <br></br>

          <Row noGutters>
            <Col md={4} style={{ paddingTop: 50, paddingRight: 0 }}>
            <img
            //   className="hate"
              src={cat1}
              alt="home pic"
            //   className="img-fluid"
              style={{ maxHeight: "150px" }}
            />
          </Col>
          <Col md={4} style={{ display: 'flex', justifyContent: 'flex-start', marginLeft: '-50px', alignItems: 'center', paddingTop: 50 }}>
          <CollapsiblePanel className="hate" title="Trade all fo Standing Cat" collapse={collapse}>
                <span style={{ display: 'flex', justifyContent: 'flex-start', alignItems: 'center', paddingTop: 50 }}>{text4}</span>
            </CollapsiblePanel>
          </Col>
          </Row>
          <br></br>
        </div>
    );
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);

